class Home extends Component {
  render() {
    return (
      <div>
        <div style={{height: '70vh', minHeight: 600, width: '100%', backgroundColor: '#565656', position: 'fixed', top: 0, zIndex: 1}}></div>
        <div style={{height: '170vh', width: '100%', top: '70vh', zIndex: 2, backgroundColor: '#f8f8f8', position: 'absolute'}}>
          asdf
        </div>
      </div>
    );
  }
}

export default Home;
